import React from "react";

const galleryImages = [
  "https://source.unsplash.com/400x400/?dance,1",
  "https://source.unsplash.com/400x400/?dance,2",
  "https://source.unsplash.com/400x400/?dance,3",
  "https://source.unsplash.com/400x400/?dance,4",
  "https://source.unsplash.com/400x400/?dance,5",
  "https://source.unsplash.com/400x400/?dance,6",
];

const Gallery = () => {
  return (
    <section className="py-20 bg-gray-50">
      <h2 className="text-4xl text-center font-bold mb-12">Gallery</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 px-6">
        {galleryImages.map((img, idx) => (
          <div key={idx} className="overflow-hidden rounded-lg shadow-lg hover:scale-105 transform transition-transform duration-300">
            <img src={img} alt={`Gallery ${idx}`} className="w-full h-64 object-cover" />
          </div>
        ))}
      </div>
    </section>
  );
};

export default Gallery;
